import SwatchDiv from './SwatchDiv'

import SwatchPickerStyle from './SwatchPickerStyle'

const Swatch = (props) => {
	//DONE swatch takes in an obj similar to colorsInSwatch
	//displays colors and color value
	//delete swatch
	//edit swatch
	//maybe convert here?

	return (
		<SwatchPickerStyle>
			<div className='swatch-container m-3'>
				<div className='d-flex justify-content-start'>
					<SwatchDiv bg={props.swatch.colors[1]} />
					{props.swatch.colors.map((color, index) => (
						<SwatchDiv bg={color} key={index} />
					))}
				</div>
				<div className='col'>
					<p>{props.swatch.name}</p>
					<button>convert</button>
				</div>
			</div>
		</SwatchPickerStyle>
	)
}

export default Swatch
